int _ceil_div(int num, int quot) {
    int off = (num>0)? quot-1 : 0;
    return (num+off)/quot;
}

void simple_blur( int n, int m, int k_size, float* image, float* kernel, float* res) {
    for (int i=0; i < n; i++) {
        for (int j=0; j < m; j++) {
            res[(i) * m + (j)] = 0.0;
        }
    }
    for (int i=0; i < n; i++) {
        for (int j=0; j < m; j++) {
            for (int k=0; k < k_size; k++) {
                for (int l=0; l < k_size; l++) {
                    if (i + k >= 1 && i + k - n < 1 && j + l >= 1 && j + l - m < 1) {
                        res[(i) * m + (j)] += kernel[(k) * k_size + (l)] * image[(i + k - 1) * m + (j + l - 1)];
                    }
                }
            }
        }
    }
}

void unroll_blur( int n, int m, int k_size, float* image, float* kernel, float* res ) {
    for (int i=0; i < n; i++) {
        for (int j1=0; j1 < _ceil_div(m, 4); j1++) {
            if (4 * j1 + 0 < m) {
                res[(i) * m + (4 * j1 + 0)] = 0.0;
            }
            if (4 * j1 + 1 < m) {
                res[(i) * m + (4 * j1 + 1)] = 0.0;
            }
            if (4 * j1 + 2 < m) {
                res[(i) * m + (4 * j1 + 2)] = 0.0;
            }
            if (4 * j1 + 3 < m) {
                res[(i) * m + (4 * j1 + 3)] = 0.0;
            }
        }
    }
    for (int i=0; i < n; i++) {
        for (int j1=0; j1 < _ceil_div(m, 4); j1++) {
            if (4 * j1 + 0 < m) {
                for (int k=0; k < k_size; k++) {
                    for (int l=0; l < k_size; l++) {
                        if (i + k >= 1 && i + k - n < 1 && 4 * j1 + 0 + l >= 1 && 4 * j1 + 0 + l - m < 1) {
                            res[(i) * m + (4 * j1 + 0)] += kernel[(k) * k_size + (l)] * image[(i + k - 1) * m + (4 * j1 + 0 + l - 1)];
                        }
                    }
                }
            }
            if (4 * j1 + 1 < m) {
                for (int k=0; k < k_size; k++) {
                    for (int l=0; l < k_size; l++) {
                        if (i + k >= 1 && i + k - n < 1 && 4 * j1 + 1 + l >= 1 && 4 * j1 + 1 + l - m < 1) {
                            res[(i) * m + (4 * j1 + 1)] += kernel[(k) * k_size + (l)] * image[(i + k - 1) * m + (4 * j1 + 1 + l - 1)];
                        }
                    }
                }
            }
            if (4 * j1 + 2 < m) {
                for (int k=0; k < k_size; k++) {
                    for (int l=0; l < k_size; l++) {
                        if (i + k >= 1 && i + k - n < 1 && 4 * j1 + 2 + l >= 1 && 4 * j1 + 2 + l - m < 1) {
                            res[(i) * m + (4 * j1 + 2)] += kernel[(k) * k_size + (l)] * image[(i + k - 1) * m + (4 * j1 + 2 + l - 1)];
                        }
                    }
                }
            }
            if (4 * j1 + 3 < m) {
                for (int k=0; k < k_size; k++) {
                    for (int l=0; l < k_size; l++) {
                        if (i + k >= 1 && i + k - n < 1 && 4 * j1 + 3 + l >= 1 && 4 * j1 + 3 + l - m < 1) {
                            res[(i) * m + (4 * j1 + 3)] += kernel[(k) * k_size + (l)] * image[(i + k - 1) * m + (4 * j1 + 3 + l - 1)];
                        }
                    }
                }
            }
        }
    }
}

